import React, { useState } from 'react';
import Todo from './Todo';




function TodoList({todos}) {

    return (
        <div class="todo-container">
            <ul class="todo-list">
                {todos.map(todo =>(
                   <Todo text={todo.text}/> 
                ))}
            </ul>
        </div>
    )
};
export default TodoList;
